/// <reference path="_references.ts"/>

module demo {

    import Skylark = skylark.Skylark;
    import Texture = skylark.Texture;

    export class Game extends skylark.Sprite {

        private static sAssets:skylark.AssetManager;

        private static BACKGROUND:string = 'data:image/png;base64,';

        public static start() {
            // start loading resources immediately
            var assets = new skylark.PxLoaderAssetManager();
            assets.enqueue('assets/pig.png');

            Game.assets = assets;

            Skylark.onReady(()=> {
                /*IntelliJ*/
                skylark.Skylark.stageDefaults = {
                    width: 320,
                    height: 480
                };

                var app = new Skylark(demo.Game).start();
            });
        }

        constructor() {
            super();
            // nothing to do here -- Startup will call "start" immediately.
        }

        public static get assets():skylark.AssetManager {
            return Game.sAssets;
        }

        public static set assets(assets:skylark.AssetManager) {
            Game.sAssets = assets;
        }
    }
}

demo.Game.start();
